"MSG_CREDIT_EXPIRATION_WARNING_MAIL_BODY" => "Det ser ut som om du inte använt något av din PamFax-kredit på rätt länge. Den blir inaktiv om du inte har använt den på 180 dagar i rad. Du har <b>{days_to_expiration} dagar</b> kvar innan din kredit blir inaktiv.\nDina kontodetaljer:\nPamFax-namn: {username}<br />Kontobehållning: {credit}\nHur håller man krediten aktiv? Det är enkelt. Gör något av följande, så kommer din PamFax-kredit att aktiveras för ytterligare 180 dagar:\n- Skicka ett faxdokument eller försättsblad (till ett giltigt eller ogiltigt nummer)<br />- Köp ett PamFax kreditpaket eller en plan från vår nätbutik  på  <a href=\"{shop_url}\">{shop_url}</a>\n\nInaktiv PamFax-kredit är inte förlorad! Du kan alltid reaktivera din PamFax-kredit vid ett senare tillfälle. Inga pengar dras från ditt konto, och inte heller tar vi något betalt för att reaktivera krediten.\n\n{email_footer}\n<br /><p style='font-family: verdana, arial, helvetica, sans-serif; font-size: 10pt'><br /><i>Hjälp med PamFax</i><br />Du kan inte svara direkt på detta e-brev, men du kan kontakta oss genom vår helpdesk på <a href=\"{website_url}support\">{website_url}support</a>\n<i>Skydda ditt lösenord</i><br />PamConsult GmbH kommer ALDRIG att fråga om ditt lösenord i ett e-brev. Enda gången du tillfrågas om lösenord är när du loggar in till PamFax eller på vår webbplats om du vill köpa något eller kontrollera ditt konto. Du loggar alltid in på PamFax-portalen via en säker förbindelse, och vi ber dig försäkra dig om att adressen i din webbläsare börjar exakt så här: <a href=\"{portal_url}\">{portal_url}</a>. Ett litet hänglås ska också visas som symbol för en säker anslutning.",
