"MSG_PLAN_EXPIRATION_WARNING_3" => "Din PamFax-plan med faxnummer {number} kommer att upphöra att gälla om 48 timmar. Detta är den sista varningen vi skickar till dig. \nFör att förlänga din PamFax-plan (och behålla ditt faxnummer), följ dessa enkla steg:\n1. Gå till PamFax-butiken: {shop_url_plans}2. Logga in med ditt PamFax användarnamn {username}3. Fullfölj betalningen. När den är klar har din faxplan förlängts.\nDu får då att använda ditt nummer ({number}) i ytterligare 3 eller 12 månader och ta emot ett obegränsat antal fax.Om du inte har gjort detta inom 48 timmar, kommer ditt personliga faxnummer ({number}) att raderas permanent.\n\nObs! Detta påverkar inte PamFax-krediten på ditt konto eller din möjlighet att skicka fax. Planen är en separat prenumeration och hör inte ihop med PamFax-krediten på ditt konto.",
