"MSG_PLAN_EXPIRATION_WARNING_EMAIL_2" => "Din PamFax-plan med faxnummer <b>{number}</b> kommer att <b>upphöra att gälla om {days_to_expiration} dagar</b> (den {expiration_date}).\nFör att förlänga din PamFax-plan (och behålla ditt faxnummer), följ dessa enkla steg:\n1. Gå till PamFax-butiken: {shop_url_plans}<br />2. Logga in med ditt PamFax användarnamn {username}<br />3. Fullfölj betalningen. När den är klar har din faxplan förlängts.\nDu får då att använda ditt nummer ({number}) i ytterligare 3 eller 12 månader och ta emot ett obegränsat antal fax.\n\nObs! Detta påverkar inte PamFax-krediten på ditt konto eller din möjlighet att skicka fax. Planen är en separat prenumeration och hör inte ihop med PamFax-krediten på ditt konto.",
