"MSG_PROPLAN_PURCHASED" => "Gratulerar! Din PamFax Professional Plan har aktiverats för de kommande {months} månaderna.\nInom kort kommer du att få ett annat chattmeddelande och/eller e-brev med ditt faxnummer. Då kan du också ta emot fax på numret.\nDina förmåner:- {months} månaders prenumeration- Gratis och obegränsad faxmottagning- Betydande rabatt på de normala faxpriserna per sida- 20 faxsidor till mottagare i zon 1 (eller motsvarande till andra zoner) varje månad- Obegränsad lagring av skickade och mottagna fax- Fri användning av PamFax Företagsadministratör, så att du kan ge anställda tillträde till din inkorg och överföra faxkredit till dem- Ingen reklam någonstans\nPlanen kommer att löpa ut den {expiredate}. Vi kommer att varna dig före förfallodagen, så att du kan förlänga planen i tid och behålla ditt nummer.",
