"MSG_WARN_PASSWORD_CHANGED" => "Ditt PamFax lösenord har ändrats.\n\nDu kan nu logga in på <a href=\"{portal_url}\">PamFax</a> med ditt PamFax användarnamn \"{userlogin}\" och det nya lösenordet.\nOm du tror att detta e-brev inte borde ha skickats till dig eller att en oauktoriserad person fått tillgång till ditt konto, var vänlig logga in till <a href=\"{portal_url}\">PamFax Portal</a> och återställ lösenord omedelbart",
"MSG_WARN_USERNAME_CHANGED" => "Ditt PamFax användarnamn har ändrats.\nTidigare användarnamn: {old_username}\n\nOm du tror att detta e-brev inte borde ha skickats till dig eller att en oauktoriserad person fått tillgång till ditt konto, var vänlig logga in till <a href=\"{portal_url}\">PamFax Portal</a> och byt lösenord omedelbart.",
"MSG_WELCOME_FAX" => "Hej!<br /><br />Tack för att du installerat PamFax.\n<br />\nVi har skickat det här första faxet för att visa att ditt faxnummer fungerar. Nu kan du skicka och ta emot fax med PamFax.\nVisste du att PamFax erbjuder följande fördelar:\n<ol>\n<li>Finns för  Microsoft Windows, Mac OS X, Android and iPhone/iPad</li>\n<li>Enkelt att skicka fax från Outlook 2007/2010, inkluderat i PamFax för Windows</li>\n<li>Gå in i Dropbox, Google Drive, OneDrive och Box</li>\n<li>Skicka fax över hela världen till attraktiva taxor</li>\n<li>Förskottsbetalning genom olika kreditpaket</li>\n<li>Ingen bortre tidsgräns för PamFax-krediten</li>\n<li>All information är krypterad hela vägen. Dina dokument är säkra.</li>\n</ol><br />\nTjäna extra gratissidor genom att rekommendera dina vänner att använda PamFax. För varje rekommenderad person som registrerar sig lägger vi automatiskt till en gratis faxsida till ditt konto.. Rekommendationsfunktionen når du via PamFax-applikationen när du har skickat ett fax eller från PamFax-portalen. Ju fler rekommendationer, desto fler gratissidor! \nVi hopppas att du är nöjd med vår service. Tveka inte att kontakta oss om du har frågor, antingen genom Supportsidan på PamFax webbplats, www.pamfax.biz, eller genom att skicka ett e-brev till “support@pamfax.biz”.>\n<br>Med vänlig hälsning,<br />The PamFax Team @ PamConsult",
